(1, 'Principio No. 1: Las empresas deben apoyar y respetar la protección de los derechos humanos reconocidos a nivel internacional.', 1, '2023-06-29'),
(2, 'Principio No. 2: Las empresas deben asegurarse de no ser cómplices de abusos a los derechos humanos.', 1, '2023-06-29'),
(3, 'Principio No. 3: Las empresas deben respetar la libertad de asociación sindical y el reconocimiento efectivo del derecho a la negociación colectiva.', 2, '2023-06-29'),
(4, 'Principio No. 4: Las empresas deben apoyar la eliminación de toda forma de trabajo forzoso u obligatorio.', 2, '2023-06-29'),
(5, 'Principio No. 5: Las empresas deben apoyar la abolición efectiva del trabajo infantil.', 2, '2023-06-29'),
(6, 'Principio No. 6: Promover la eliminación de la discriminación en materia de empleo y ocupación.', 2, '2023-06-29'),
(7, 'Principio No. 7: Apoyar la aplicación de un criterio de precaución respecto de los problemas ambientales.', 3, '2023-06-29'),
(8, 'Principio No. 8: Adoptar iniciativas para promover una mayor responsabilidad ambiental.', 3, '2023-06-29'),
(9, 'Principio No. 9: Alentar el desarrollo y la difusión de tecnologías inocuas para el medio ambiente.', 3, '2023-06-29'),
(10, 'Principio No. 10: Las empresas deben actuar contra todas las formas de corrupción, incluyendo la extorsión y el soborno.', 4, '2023-06-29');

