INSERT INTO `preguntas` (`pregunta_id`, `enunciado`, `fecha_creada`, `item_id`) VALUES
(1, 'Periódicamente se aplican mecanismos en la empresa con el propósito de evaluar y vigilar que se respeten los derechos humanos de los trabajadores.', '2023-06-29', 1),
(2, 'Periódicamente se aplican mecanismos para la difusión de los derechos humanos con el personal de la empresa, la comunidad, los proveedores y otras partes interesadas.', '2023-06-29', 1),
(3, 'Se tienen establecidos mecanismos para evaluar si las decisiones que toma la empresa impactan, tanto positiva como negativamente, los derechos humanos de los trabajadores y partes interesadas.', '2023-06-29', 1),
(4, 'Se tienen establecidos los medios en la empresa para la atención de los reclamos de violaciones de los derechos humanos en la empresa.', '2023-06-29', 1),
(5, 'Se tienen establecidos mecanismos para mejorar el cumplimiento y respeto de los derechos humanos de los trabajadores y de las partes interesadas.', '2023-06-29', 1),
(6, 'Se tienen establecidos mecanismos para determinar y vigilar que no se realicen en la empresa acciones de violación de los derechos humanos en forma directa.', '2023-06-29', 2),
(7, 'Se tienen establecidos mecanismos en la empresa para determinar y vigilar que no se compren o contraten bienes o servicios de proveedores que realizan acciones de violación de los derechos humanos (complicidad beneficiosa).', '2023-06-29', 2),
(8, 'Se tienen establecidos mecanismos en la empresa para determinar y vigilar que no se realizan acciones de violación de los derechos humanos en la comunidad en la que se pertenece (complicidad silenciosa).', '2023-06-29', 2),
(9, '¿Se cuentan con mecanismos en la empresa (políticas, programas, sistemas de administración, etc.) que protejan la libertad de asociación y sindical independientes a la legislación local?', '2023-06-29', 3),
(10, '¿Cuenta con los mecanismos para demostrar que los trabajadores cuentan con la libertad para formar y unirse al sindicato de su elección sin temor a ser intimidados o a sufrir represalias?', '2023-06-29', 3),
(11, '¿Se reconocen a los sindicatos o representantes de los trabajadores para realizar con ellos la negociación colectiva de las condiciones y metas del trabajo?', '2023-06-29', 3),
(12, '¿Se utilizan los convenios o contratos colectivos de trabajo como medio de información sobre los términos y condiciones laborales, así como para reforzar las relaciones entre los contratantes y empleados?', '2023-06-29', 3),
(13, '¿Se tienen mecanismos para determinar la eficacia de las acciones establecidas en este principio?', '2023-06-29', 3),
(14, '¿Se cuenta en la empresa con mecanismos de información sobre políticas establecidas en contra de cualquier tipo de trabajo forzoso u obligatorio?', '2023-06-29', 4),
(15, '¿Los empleados conocen los términos y condiciones del servicio para el que fueron contratados, así mismo, es de su conocimiento la naturaleza voluntaria del trabajo y la libertad de abandonarlo, en apego a los procedimientos adecuados para este fin?', '2023-06-29', 4),
(16, '¿Se cuentan con mecanismos para que cualquier trabajador denuncie condiciones de trabajo forzoso u obligatorio (ejemplo: amenazas de despido, solicitud de depósitos o garantías para realizar el trabajo, condiciones inadecuadas de trabajo que pongan en riesgo su integridad)?', '2023-06-29', 4),
(17, '¿Se cuentan con mecanismos para verificar que el salario otorgado se encuentra dentro de los límites establecidos en la regulación laboral?', '2023-06-29', 4),
(18, '¿Se cuentan con mecanismos para vigilar las condiciones laborales, el análisis de la información obtenida y la implantación de acciones correctivas, preventivas o de mejora con el propósito de mejorar el cumplimiento de este principio?', '2023-06-29', 4),
(19, '¿Se tienen establecidos en la empresa mecanismos y políticas para que sólo se contraten niños que tengan la edad mínima para trabajar según las leyes y regulaciones nacionales?', '2023-06-29', 5),
(20, '¿Si es el caso, se tienen establecidos mecanismos para que los niños trabajen solo las horas establecidas en las leyes y regulación nacional?', '2023-06-29', 5),
(21, '¿Cuentan con programas o apoyos para que los niños continúen sus estudios, reciban capacitación o asesoramiento (incluyendo, si es necesario a los padres del menor)?', '2023-06-29', 5),
(22, '¿Cuentan con programas de capacitación y/o auditoría para los proveedores de la empresa con respecto a que estas apoyen que se elimine el trabajo infantil?', '2023-06-29', 5),
(23, 'En los procesos de gestión del personal se tienen mecanismos que previenen la discriminación, la supervisan y le dan seguimiento, a fin de evitarla en todas sus formas', '2023-06-29', 6),
(24, 'En el proceso de selección y contratación del personal se evita la discriminación por edad, religión, raza, género, opinión política, nacionalidad, etc.', '2023-06-29', 6),
(25, 'En el proceso de administración de sueldos y promociones al personal se mantiene una política de igualdad de oportunidades considerando las competencias.', '2023-06-29', 6),
(26, 'En los programas de capacitación y desarrollo del personal se mantiene la igualdad de oportunidades considerando las competencias', '2023-06-29', 6),
(27, 'Existen mecanismos de revisión periódicos que aseguren la no discriminación del personal en cualquiera de sus formas', '2023-06-29', 6),
(28, 'Se cuenta con indicadores que muestren la igualdad de oportunidades en aspectos de género, edad, etc.', '2023-06-29', 6),
(29, 'Se cuenta con una política de prevención de impacto al medio ambiente.', '2023-06-29', 7),
(30, 'Los proyectos o actividades susceptibles de causar impacto al medio ambiente se encuentran sometidos al sistema de evaluación periódica correspondiente.', '2023-06-29', 7),
(31, 'Se adoptan medidas para prever el gasto excesivo de energía y agua en el desarrollo de sus actividades.', '2023-06-29', 7),
(32, 'Se tienen identificadas las áreas y procesos críticos en materia de impacto ambiental, se cuenta con medidas preventivas.', '2023-06-29', 7),
(33, 'Las medidas preventivas contemplan un sistema de indicadores para dar seguimiento periódico a su cumplimiento.', '2023-06-29', 7),
(34, 'En los procesos y el manejo de productos existe una gestión responsable y ética con respecto a la salud, la seguridad y los aspectos ambientales.', '2023-06-29', 8),
(35, 'En los procesos se mantiene una política de reciclaje en los materiales que utiliza.', '2023-06-29', 8),
(36, 'En el enfoque medioambiental se contempla la creación de conciencia ambiental entre su personal.', '2023-06-29', 8),
(37, 'Se cuentan con la descripción de los impactos medioambientales de sus principales productos o servicios.', '2023-06-29', 8),
(38, 'El control de emisión de gases y sustancias perjudiciales previenen el impacto al medio ambiente.', '2023-06-29', 8),
(39, 'Se garantiza el manejo limpio en las cadenas de abastecimiento.', '2023-06-29', 8),
(40, 'Se aplican medidas correctivas al detectar alguna no conformidad en sus procesos críticos de impacto ambiental.', '2023-06-29', 8),
(41, 'Se mantienen registros de accidentes y multas por la falta de cumplimiento a las leyes y normas existentes.', '2023-06-29', 8),
(42, 'Se está al tanto de los adelantos en la tecnología en materia ambiental para implementarla según las posibilidades de la empresa.', '2023-06-29', 9),
(43, 'Dentro de los planes a futuro se pretende cambiar los procesos o técnicas de manufactura hacia una tecnología más ecológicas.', '2023-06-29', 9),
(44, 'Se utilizan materiales biodegradables y de reducidos niveles de toxicidad.', '2023-06-29', 9),
(45, 'Se reutilizan materiales: Separando, tratando y recuperando los desperdicios y materiales útiles.', '2023-06-29', 9),
(46, 'Se tienen identificados los procesos susceptibles de corrupción y cohecho.', '2023-06-29', 10),
(47, 'Los procesos cuentan con candados para evitar los sobornos y el cohecho.', '2023-06-29', 10),
(48, 'Existe una política que prevenga los actos de corrupción y se capacita al personal contra la corrupción y el soborno.', '2023-06-29', 10),
(49, 'Existen mecanismos de revisión internos que identifican los actos de corrupción y soborno del personal de manera periódica.', '2023-06-29', 10),
(50, 'Se adoptan las medidas necesarias para corregir los actos de corrupción identificados en las revisiones.', '2023-06-29', 10);

